import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { login } from '../services/authService';
import '../styles/Login.css';
import axios from 'axios';

function Login() {
  const [formData, setFormData] = useState({ email: '', password: '' });
  const [role, setRole] = useState('user'); // 'user' or 'admin'
  const [centers, setCenters] = useState([]);
  const [selectedCenter, setSelectedCenter] = useState('');
  const [message, setMessage] = useState('');
  const navigate = useNavigate();

  // Fetch centers only if role is user
  useEffect(() => {
    if (role === 'user') {
      axios.get('/api/centers')
        .then(response => setCenters(response.data))
        .catch(err => console.error("Error fetching centers:", err));
    }
  }, [role]);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleRoleChange = (e) => {
    setRole(e.target.value);
    if (e.target.value === 'admin') {
      setSelectedCenter('');
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const payload = { ...formData };
    if (role === 'user') {
      payload.center = selectedCenter;
    }
    try {
      const response = await login(payload);
      localStorage.setItem('token', response.token);
      localStorage.setItem('role', response.role);
      if (response.permissions) {
        localStorage.setItem('permissions', JSON.stringify(response.permissions));
      }
      navigate('/dashboard');
    } catch (error) {
      setMessage(error.response?.data?.message || 'Login failed');
    }
  };

  return (
    <div className="login-container">
      <div className="login-card">
        <h2>Login</h2>
        <div className="role-selection">
          <label>
            <input
              type="radio"
              name="role"
              value="admin"
              checked={role === 'admin'}
              onChange={handleRoleChange}
            />
            Admin
          </label>
          <label>
            <input
              type="radio"
              name="role"
              value="user"
              checked={role === 'user'}
              onChange={handleRoleChange}
            />
            User
          </label>
        </div>

        <form onSubmit={handleSubmit}>
          <div className="input-group">
            <input
              type="email"
              name="email"
              placeholder="Email"
              value={formData.email}
              onChange={handleChange}
              required
            />
          </div>
          <div className="input-group">
            <input
              type="password"
              name="password"
              placeholder="Password"
              value={formData.password}
              onChange={handleChange}
              required
            />
          </div>
          {role === 'user' && (
            <div className="input-group">
              <select
                name="center"
                value={selectedCenter}
                onChange={(e) => setSelectedCenter(e.target.value)}
                required
              >
                <option value="">Select Centre</option>
                {centers.map(center => (
                  <option key={center.code} value={center.code}>
                    {center.name}
                  </option>
                ))}
              </select>
            </div>
          )}
          <button type="submit" className="login-button">Login</button>
        </form>

        {message && <p className="login-message">{message}</p>}
{/* 
        <p className="login-link">
          Don't have an account? <a href="/register">Register</a>
        </p> */}
        <p className="login-link">
          Forgot Password? <a href="/forgot-password">Forgot Password?</a>
        </p>
      </div>
    </div>
  );
}

export default Login;
